import * as style from "../../css/phoneListContainer"

export default function ListDeviceItem(props) {
  // for (let item in props) console.log(props[item])
  
  const renderAltIndex = () => {
    Object.entries(props).map(([key])=>{
      console.log("here", props[key])
      // return(
      //   <li style={style.phoneListContainerItem}>
      //     {props[key]}
      //   </li>)
    })
  }

  renderAltIndex()

  return (
    <div style={style.phoneListContainer}>
      <div style={style.phoneListContainerMAC}>
        {props.mac}
      </div>
      <div style={style.phoneListContainerInfo}>
        <ul style={style.phoneListContainerItems}>
          <li style={style.phoneListContainerItem}>
            {props.user}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.line}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.mask}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.ip}
          </li>
          <li style={style.phoneListContainerItem}>
            {props.location}
          </li>
        </ul>
      </div>
    </div>
  )
}
